import React from "react";
import styled from "styled-components";

const LeftbarPositioner = styled.div`
  width: 7rem;
  height: 100vh;
  border-style: solid;
`;

const LeftbarHeader = styled.div`
  text-align: center;
  border-style: solid;
`;

function Sidebar() {
  return (
    <LeftbarPositioner>
      <LeftbarHeader>MY SPACE</LeftbarHeader>
    </LeftbarPositioner>
  );
}

export default Sidebar;
